import React from "react";
import "../../css/header.css";
import SearchIcon from "@mui/icons-material/Search";
import { Navbar, Container } from "react-bootstrap";
import logo from "../../assets/logo/Logo.png";
import Button from "@mui/material/Button";
function Header() {
  return (
    <div>
      <Navbar bg="light" expand="lg">
        <Container fluid className="d-flex justify-content-between px-5">
          <div className="d-flex justify-content-around w-50">
            <img src={logo} alt="" />
            <div className="mx-5 w-100">
              <input type="text" placeholder="search for product" className="searchTerm" />
              <button type="submit" className="searchButton">
                <SearchIcon />
              </button>
            </div>
          </div>

          <div>
            <Button variant="contained" style={{ background: "#917BE7" }}>
              Donate Item
            </Button>
            <div style={{ borderRight: 1, borderRightColor: "black", height: 24 }}></div>
          </div>
        </Container>
      </Navbar>
    </div>
  );
}

export default Header;
